import './App.css';
import React from 'react';
import axios from 'axios';

function searchStation() {
  axios.get("http://localhost:9999/foo", {
    params: {
      stationID: "3"
    }
  }).then((res) => {
    console.log(res.data);
  });
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <input></input>
        <button onClick={(e) => searchStation(e.target.value)}>Search</button>
      </header>
    </div>
  );
}

export default App;
